function Nav() {
  return (
    <div class="flex flex-row bg-sky-500 h-[72px] w-[1564px] rounded-[70px]">
    <div class="basis-1/4">TechCare</div>
    <div class="basis-1/4">02</div>
    <div class="basis-1/2">03</div>
  </div>
  );
}

export default Nav;
